INSERT INTO `vcos_common_problems_language` VALUES (1,91,'zh_cn','我会不会晕船','<p>答：应该不会。邮轮的航线，都以当地的季节、气候、海象 等因素为重要考虑。除非遇上了恶劣的天候，海面上才有较 大的风浪，故大部份的航程，都是相当平稳的，甚至感觉不到邮轮在前进。<br/>豪华邮轮均配备高科技的平衡装置，能够减轻船体部份的晃动到最小，晕船的机率已大幅降低。</p>'),(3,189,'zh_cn','是否可以上网？','当然可以。您可以在自己的舱房或者一些公共区域连接到无线网络，使用支持无线网络的笔记本电脑，通过覆盖在邮轮上的无线网络上网。事先从网络服务供应商(ISP)订购网页版邮件服务的乘客，建议在上船前核实您的网页邮件查看功能。大部分ISP都有指定的网站，让您可以通过邮箱地址和密码直接在浏览器上查看邮件。关于网络收费要求及其它信息，请联系服务人员。'),(4,191,'zh_cn','我生病了该怎么办？','<p>请放心，船上有医务室及驻船医生，为您提供医疗救助及紧急状况的处理。如果状况非常紧急，我们会联络岸上的医疗队派遣直升机进行救援。以上产生的费用，需乘客自行承担。</p>'),(17,91,'en','wohuibuhuiyunchuan','<p>zhegebuhaoshuoya</p>'),(33,223,'zh_cn','在邮轮上如何购物？如何付费？','<p style=\"white-space: normal;\">邮轮上均使用无现金交易的房卡签账系统。消费时只要出示房卡即可，个别要求使用现金的场所例外，如外币兑换、以及娱乐场博彩。在航程的最后一晚， 邮轮将明细账单送到您的客房以供核对，并请至前台付清您的消费账目，如果您已经向天海邮轮提供了信用卡信息，并且开通了房卡自动还款功能，对邮轮\r\n所列清单上的项目没有异议，邮轮会自动根据账单向您的银行请款，您无需至前台付款。如果您对账单项目或退款有任何异议，请务必离船前联系前台工作人员\r\n解决。因为您下船后，邮轮公司恕不能受理有关消费清单的异议。 &nbsp; &nbsp;</p><p><br/></p>'),(35,225,'zh_cn','我一定要参加船上的活动吗？ ','<p style=\"white-space: normal;\">除非是强制性的海上安全演习，邮轮上，您可以做您想做的事。或躺下不做任何事，那是您的假期。</p><p><br/></p>'),(37,227,'zh_cn','邮轮上的夜晚可以做什么？ ','<p>在夜晚，船上的生活才正要开始。多样的丰富活动，像是舞蹈，夜总会现场表演，DISCO，酒吧，电影和新朋友的聚会。船上也有赌场，还有许多特别活动，例如船长鸡尾酒会，乘客的才艺表演，午夜自助餐。您想到玩到多晚都可以，甚至直到欣赏海上壮观的日出。</p>'),(39,229,'zh_cn','我可以携带多少重量的行李？','<p>登船规定的行李最大重量为60公斤。此外也请谨记国际及国内班机对行李携带量的限制条件。 登船当天可在携带的行李上贴挂行李牌（在其上写明乘客的姓名、航次及所住客房的号码），船上工作人员会将行李送到指定客房。 &nbsp;</p>'),(41,231,'zh_cn','携带药品规定？ ','<p>邮轮公司要求所有有特殊医疗需求的客人在旅行出发前提供自己的医疗信息。这是为了确保在发生紧急情况的时候能基于这些必要信息给予您适当的治疗和照顾。因医疗用途而携带注射器的旅客需要有医生证明。如需携带胰岛素注射器。 &nbsp; &nbsp;</p>'),(43,233,'zh_cn','我可否携带饮料和食物上船？ ','<p>除酒精型饮料不得携带上船外，其它饮料及水皆可带上船。在船上购买的酒精型饮料需要先寄存在邮轮上，在邮轮旅行的最后一晚由船上的服务人员将其送回您的客\r\n房。您可携带干粮上船，如饼干，薯片，能量条等。 您也可以带上单独包装的沙拉，天海邮轮不接收，储存或烹饪游客自带的需烹饪食品。\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>'),(45,235,'zh_cn','邮轮上的用餐情形如何？','<p>邮轮船票包括免费餐厅的用餐。邮轮上设有固定的用餐时间，提供早餐，中餐，晚餐，以及24小时的点餐服务（收费项目）。用餐种类有特色自助餐，正宗西餐，您可以根据自己的需求自由选择。同时，除免费餐厅外，邮轮上还提供自费特色餐厅，您可以品尝世界各地的美食。 &nbsp;</p>'),(47,237,'zh_cn','船上的餐厅是24小时开放吗？ ','<p>船上的餐厅很多，开放时间各不相同。一般用餐时间都会开放。另外船上有 24 小时的送餐服务（收费项目），保证您在任何时刻都可以享受到您想要的饮食。\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>'),(49,239,'zh_cn','如果我有特殊餐食要求该如何做？','<p>邮轮可以满足下列特殊饮食需求：素食主义者，糖尿病，低脂肪，低钠盐，低胆固醇饮食。除了主餐厅，其它餐厅不接受特殊餐饮安排要求。请在邮轮旅行开始\r\n前事先以书面形式提交您的饮食要求，并尽可能提供足够的详细信息。我们会努力满足合理的要求，但不保证能全部满足。上船后，请与餐厅领班联系，检查菜单，\r\n若有任何问题，敬请提出。 &nbsp; &nbsp;</p>'),(51,241,'zh_cn',' 船票都包含什么？上船后还有什么付费项目？','<p>邮轮所列船票已经包括了所有的码头税和政府税。船票包含了船上膳食（不包括酒类、特饮及收费餐厅），您所预订的舱房住宿，所有公共设施使用和所有娱乐表演；不包括船上服务费，往返码头交通费，上岸观光团费用和私人消费（如理发，按摩，上网，电话，赌场筹码及商场购物等）。\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>'),(53,243,'zh_cn','我如何知道在船上消费了多少金额？ ','<p>在您下船的前一天，您会收到关于您信用卡消费的明细单，如果发现任何问题，请及时到客服柜台核实。你也可以随时到船上总服务台去进行询问。\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>'),(55,245,'zh_cn','船上是按什么汇率进行兑换？ ','<p>船上是按照当日交易汇率进行货币的兑换，一般来说，会略微高于国家对外公布的外币汇率。\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>'),(57,247,'zh_cn','船上是否要支付服务费(小费)？ ','<p>船上的服务费(小费)为船上现付的，显示在乘客本人的“船上消费账单”中，乘客需要在下船前将账单结清，并不是预先收取的。\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; <br/></p><p>&nbsp;参考费用：内舱、海景、阳台等舱位每人12美金/晚，套房及以上舱位每人14美金/晚。\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>'),(59,249,'zh_cn','什么是岸上观光？','<p>在每一个靠岸点都有许多不同的岸上行程供旅客选择。您可根据自己的需要进行选择。所有岸上观光团的详细行程资料、价目并连同报名表将会在登船期间一并派\r\n发;旅客只需选择合适行程并填上有关数据交回岸上观光查询柜台，而观光团票将会集中所有数据后派发到房间;旅客可选择同时报名参加所有口岸的岸上观光团，\r\n或于每个口岸截止报名时间之前报名参加（截止时间请参考每日的节目表）。所有观光团在报名确认后将不能退款，请旅客细心选择行程。邮轮在每个口岸均会按指\r\n定时间关闸准备启航（所有时间为当地时间），请各旅客留意每天节目表及于舷梯出口刊登的时间。每位旅客必须携同其邮轮卡登岸。 &nbsp; &nbsp;</p>'),(61,251,'zh_cn','岸上观光会有导游吗？','<p>大部分岸上观光是团进团出的，有大巴接送，还会配备中文地接。\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>'),(63,253,'zh_cn','我必须通过邮轮预订我的岸上游行程吗？','<p>预订岸上游的方法有两种: 一、通过天海官网提交预订单，大部分航线产品内提供岸上游行程供选择。二、通过您的邮轮代理或委托的旅行社预订咨询或者预订岸上游行程。\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>'),(67,257,'zh_cn','那些东西不能带上船？','<p>易燃易爆，有毒物品不能带上船上，枪支弹药也禁止带上船上<br/></p>');

