INSERT INTO `vcos_cruise_deck_point_language` VALUES (3,5,'医院','cruiseinfo_images/201510/201510081443554540.png','位于第二层甲板中部，邮轮房间都设有冰柜，不用担心胰岛素等需要冷 藏的药物没办法放置。如果一些突发症状无法缓解，可到船上前台，联 系船医，进行一些紧急治疗。​','<p>位于第二层甲板中部，邮轮房间都设有冰柜，不用担心胰岛素等需要冷 藏的药物没办法放置。如果一些突发症状无法缓解，可到船上前台，联 系船医，进行一些紧急治疗。</p>','zh_cn'),(15,13,'棋牌室','cruiseinfo_images/201510/201510081450449971.png','位于第三层甲板偏头部，棋牌室，是供人进行棋牌游戏的场所，是比较 大众化的休闲娱乐场所。娱乐项目有： 麻将、扑克牌、牌九、百家乐、 象棋、围棋、五子棋、黑白棋等。','<p>位于第三层甲板偏头部，棋牌室，是供人进行棋牌游戏的场所，是比较\r\n大众化的休闲娱乐场所。娱乐项目有： 麻将、扑克牌、牌九、百家乐、\r\n象棋、围棋、五子棋、黑白棋等。</p>','zh_cn'),(17,15,'冲浪水疗按摩池','cruiseinfo_images/201510/201510081455574836.png','位于第四层甲板尾部，“美容美肌、深度清洁、保健理疗和恢复活力五 大功效，给人活力，给人健康，塑身健美。','<p>位于第四层甲板尾部，美容美肌、深度清洁、保健理疗和恢复活力五大功效，给人活力，给人健康，塑身健美。</p>','zh_cn'),(29,37,'日光浴场','cruiseinfo_images/201510/201510081530505266.png','位于第五层甲板尾部，可以在阳光海泳池吧前晒晒太阳','<p>位于第五层甲板尾部，可以在阳光海泳池吧前晒晒太阳，喝着果汁，看\r\n着远方的夕阳，这种惬意的海上生活，让人流连忘返。</p>','zh_cn'),(31,39,'望海轩餐厅','cruiseinfo_images/201510/201510081532309374.png','位于第五层甲板尾部，坐在望海轩，才真正地领略到人与自然的和谐相 处和天人合一的理想境界','<p>位于第五层甲板尾部，坐在望海轩，才真正地领略到人与自然的和谐相处和天人合一的理想境界；也只有在这里，才能感受和体会到祖籍国的伟大，母亲的慈怀，家的温暖和亲人们的深情,一个海岛上的中国美食餐厅。</p>','zh_cn'),(33,41,'中央大厅','cruiseinfo_images/201510/201510081533431251.png','位于第五层甲板偏头部，对于通风和照明的设计是比较严格的，尤其是 通风的设计，用于会客、宴会、行礼、展览等。','<p>位于第五层甲板偏头部，对于通风和照明的设计是比较严格的，尤其是\r\n通风的设计，用于会客、宴会、行礼、展览等。</p>','zh_cn'),(35,43,'  旅游服务中心','cruiseinfo_images/201510/201510081534578936.png','位于第五层甲板偏头部，践行“良好的服务形象、良好的技术、良好的 客户关系','<p>位于第五层甲板偏头部，践行“良好的服务形象、良好的技术、良好的\r\n客户关系、良好的品牌”的核心服务理念，以最专业性的人员，及时和\r\n全方位地关注乘客的每一个服务需求，并通过提供广泛、全面和快捷的\r\n服务，使乘客体验到无处不在的满意和可信赖的贴心感受。</p>','zh_cn'),(37,45,'总服务台','cruiseinfo_images/201510/201510081536094505.png','位于第五层甲板偏头部，“乘客户永远是第一位”，从客户的实际需求 出发，帮助乘客解决问题，让乘客更加了解邮轮。','<p>位于第五层甲板偏头部，“乘客户永远是第一位”，从客户的实际需求\r\n出发，帮助乘客解决问题，让乘客更加了解邮轮。</p>','zh_cn'),(39,47,'娱乐场水吧','cruiseinfo_images/201510/201510081537434856.png','位于六层甲板尾部，水吧是为年轻人提供的休闲场所','<p>位于六层甲板尾部，水吧是为年轻人提供的休闲场所，提供各种时尚饮品、咖啡、茶饮等，环境温馨，有休闲沙发卡座，并附带提供各种简单娱乐工具和图书杂志。功能定位在于给年轻人提供一个可以休闲放松心情的私人空间。</p>','zh_cn'),(41,49,'娱乐场','cruiseinfo_images/201510/201510081539111165.png','位于六层甲板尾部，跟随时代发展,把邮轮娱乐场的功能再次完善','<p>位于六层甲板尾部，跟随时代发展,把邮轮娱乐场的功能再次完善,令邮\r\n轮娱乐场发挥到及至,使您在邮轮娱乐场体验独一无二的感觉,带来了邮\r\n轮海上娱乐场。</p>','zh_cn'),(43,51,'  风情海酒吧','cruiseinfo_images/201510/201510081541277827.png','位于第六甲板中部，酒吧也会经常举办派对活动','<p>位于第六甲板中部，酒吧也会经常举办派对活动（如节假日派对，单身派\r\n对，制服派对等），是人们在工作之余用来消遣和放松的好地方，当然\r\n邮轮上也是一个好去处只要你愿意，可以随时打开心扉，和平生第一次\r\n见到的人谈感兴趣的话题。天文、地理、感情、事业，只要对方同样感\r\n兴趣，你们可以聊上一个通宵。</p>','zh_cn'),(45,53,'免税店②','cruiseinfo_images/201510/201510081543084398.png','位于第六甲板中部，营业时间请以邮轮广播为准。免税的烟酒，总是会 有您想要的一款，欢迎您光临选购！','<p>位于第六甲板中部，营业时间请以邮轮广播为准。免税的烟酒，总是会\r\n有您想要的一款，欢迎您光临选购！</p>','zh_cn'),(47,55,'  免税店①','cruiseinfo_images/201510/201510081544358119.png','位于第六甲板中部，营业时间请以邮轮广播为准。免税的烟酒，总是会 有您想要的一款，欢迎您光临选购！','<p>位于第六甲板中部，营业时间请以邮轮广播为准。免税的烟酒，总是会\r\n有您想要的一款，欢迎您光临选购！</p>','zh_cn'),(49,57,'星光精品廊','cruiseinfo_images/201510/201510091717279123.jpg','位于第六甲板中部，精品廊一直紧跟时尚潮流与国内流行消费趋势','<p>位于第六甲板中部，精品廊一直紧跟时尚潮流与国内流行消费趋势，不\r\n断提供时尚新颖的时尚饰品箱包。精品廊所在线销售的商品全部是经过\r\n我们在千百种产品中精挑细选出的精品，每一件商品都有自己的特色，\r\n每件产品在登陆之前都经过网站编辑的层层筛选，这个将是我们自始至\r\n终所坚定的服务原则。</p>','zh_cn'),(51,59,'便利店','cruiseinfo_images/201510/201510081555474671.png','位于第六甲板，便利店的主打商品应在食品、饮料及日常用品上','<p>位于第六甲板，便利店的主打商品应在食品、饮料及日常用品上，这些\r\n商品不求多、全，而应求精，即选择畅销的、质量高的、价格又适中的\r\n产品上架。</p>','zh_cn'),(53,61,'照相馆','cruiseinfo_images/201510/201510081556556986.png','位于第六层甲板中部，免税店旁边营业时间09：00-12：00， 16：00-21：30　抓住最后机会选选购属于您在各场合拍下的美丽照片。','<p>位于第六层甲板中部，免税店旁边营业时间09：00-12：00，\r\n16：00-21：30　抓住最后机会选选购属于您在各场合拍下的美丽照片，\r\n并配有各种各样的背景装饰，为你的照片增添无限的时尚感。</p>','zh_cn'),(55,63,'  免税店③','cruiseinfo_images/201510/201510081558143243.png','位于第六层甲板中部，位于第六甲板中部，营业时间请以邮轮广播为准。 免税的各种物品，总是会有您想要的一款，欢迎您光临选购！','<p>位于第六层甲板中部，位于第六甲板中部，营业时间请以邮轮广播为准。\r\n免税的各种物品，总是会有您想要的一款，欢迎您光临选购！</p>','zh_cn'),(57,65,'剧场水吧','cruiseinfo_images/201510/201510081559422329.png','位于第六层甲板偏头部，剧场水吧是为提供的休闲场所，提供各种时尚 饮品、咖啡、茶饮等，环境温馨','<p>位于第六层甲板偏头部，剧场水吧是为提供的休闲场所，提供各种时尚\r\n饮品、咖啡、茶饮等，环境温馨，有休闲沙发卡座，并附带提供各种简\r\n单娱乐工具和图书杂志，一个可以休闲放松心情的私人空间。</p>','zh_cn'),(59,67,'海上儿童乐园','cruiseinfo_images/201510/201510081600526125.png','位于第六层甲板偏头部，供儿童游戏玩耍的公共场合,园内有组合滑梯、 动物造型滑梯、人工转椅、电动转椅、脚踩转筒、各种造型的电动碰 碰车、碰转结合的电动警车等。','<p>位于第六层甲板偏头部，供儿童游戏玩耍的公共场合,园内有组合滑梯、\r\n动物造型滑梯、人工转椅、电动转椅、脚踩转筒、各种造型的电动碰\r\n碰车、碰转结合的电动警车等。这些游乐设施小巧别致，色彩明快，为\r\n儿童所喜闻乐见</p>','zh_cn'),(61,69,'梦幻海剧场','cruiseinfo_images/201510/201510081605095056.png','精彩绝伦的舞蹈和甜歌天后迷人的歌声是这一天美妙的开始。','<p>精彩绝伦的舞蹈和甜歌天后迷人的歌声是这一天美妙的开始。这一天为您带来的是具\r\n有浓浓中华民族韵味的节目。\r\n独特的傣族舞蹈，真正深入地展示出中华民族深厚的文化底蕴和民族情谊。变脸是中\r\n国的国粹精华，这种运用在川剧艺术塑造人物的特技，层出不穷的变换脸谱会让您惊\r\n叹不已。</p>','zh_cn'),(63,71,'  阳光海泳池','cruiseinfo_images/201510/201510081607341759.jpg','位于第七甲板尾部，池长4米，池宽3米，池深2米。','<p>位于第七甲板尾部，池长4米，池宽3米，池深2米。日光浴场的四周用\r\n\t\t\t\t\t\t\t\t落地玻璃围绕，高度有两层甲板那么巨大，日光浴场配有毛绒作为和太\r\n\t\t\t\t\t\t\t\t阳椅，传统的泳池周围设计有豪华舒适的个性休息室，拥有的的太阳椅\r\n\t\t\t\t\t\t\t\t数也是比较多的。透过落地的玻璃窗似乎有悬浮于海天之间的感觉非\r\n\t\t\t\t\t\t\t\t常飘渺。</p>','zh_cn'),(65,73,'阳光海泳池吧','cruiseinfo_images/201510/201510081608585639.png','位于第七甲板尾部，可以在阳光海泳池吧前晒晒太阳，喝着果汁，看着远方的夕阳，这种惬意的 海上生活，让人流连忘返','<p>位于第七甲板尾部，可以在阳光海泳池吧前晒晒太阳，喝着果汁，看着远方的夕阳，这种惬意的 海上生活，让人流连忘返</p>','zh_cn'),(67,75,'  日光浴场','cruiseinfo_images/201510/201510081609514038.png','位于第七甲板尾部，日光浴场配有毛绒作为和太阳椅，传统的泳池周围 设计有豪华舒适的个性休息室，拥有的的太阳椅数也是比较多的。','<p>位于第七甲板尾部，日光浴场配有毛绒作为和太阳椅，传统的泳池周围 设计有豪华舒适的个性休息室，拥有的的太阳椅数也是比较多的。</p>','zh_cn'),(69,77,'  爱恋海SPA会馆','cruiseinfo_images/201510/201510091649248215.jpg','位于7层甲板中部爱恋海SPASpa','<p>位于7层甲板中部爱恋海SPA，可眺望海上的风景，这里所用的SPA\r\n产品，是可以根据你的喜好所选择的，包括LA PRAIRIE,ESPA和\r\nAromatherapy Associates等等。另外，SPA所有盥洗用具都是\r\nHermes，包括肥皂、古龙水等。当然了房间内的淋浴设备也不同凡响，\r\n除可选择上中下三段式喷水莲蓬头之外，旁边还有马赛克壁画陪衬下的\r\n按摩浴池。专属于你的豪华套房内金碧辉煌，岂能用言语形容之!至于疗\r\n程，更是把你当成了苏丹伺候，舒服得让人5分钟就自然进入梦乡！</p>','zh_cn'),(71,79,'欢乐海舞厅','cruiseinfo_images/201510/201510091715124646.jpg','位于五层甲板头部，备有跳舞设施的公共大厅或舞场，也是集个性化、 灵活性和娱乐性为一体的场所。大家可以聚在一起狂欢，喝酒，唱歌， 跳舞来助兴。','<p>位于五层甲板头部，备有跳舞设施的公共大厅或舞场，也是集个性化、\r\n灵活性和娱乐性为一体的场所。大家可以聚在一起狂欢，喝酒，唱歌，\r\n跳舞来助兴。</p>','zh_cn'),(73,5,'yiyuan','cruiseinfo_images/201510/201510121445434226.jpg','two','<p>two</p>','en');

