DROP TABLE IF EXISTS `vcos_line_language`;
CREATE TABLE `vcos_line_language` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `line_id` int(10) unsigned NOT NULL,
  `iso` varchar(60) NOT NULL,
  `line_name` varchar(255) NOT NULL,
  `voyage_time` varchar(255) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `line_id&iso` (`line_id`,`iso`)
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=utf8 COMMENT='航线语言表';

