INSERT INTO `vcos_meetingroom_language` VALUES (1,3,'zh_cn','<p>纟</p>'),(4,3,'en','<p>open room<br/></p>'),(5,15,'zh_cn','<p>大会议室子民<br/></p>'),(7,15,'en','<p>dahuiyishi上<br/></p>'),(9,17,'zh_cn','<p>可分别满足10－40人的会议，免费提供基础设备。</p>'),(11,17,'en','<p>da<br/></p>'),(19,21,'zh_cn','<p>大家可在这里讨论问题，探讨学术问题，演示ppt，远程视屏都可以做的事情。</p>'),(21,23,'zh_cn','<p>中型会厅可容纳10-50人．并可提供相关的会议服务设备，以及茶歇，饮用水等服务。</p>'),(23,25,'zh_cn','<p>大家可在这里讨论问题，探讨学术问题，演示ppt，远程视屏都可以做的事情。<br/></p>'),(25,27,'zh_cn','<p>免费提供设施指示牌、话筒、白板、笔纸、主席台、茶水、演讲台、植物。在我们的会议楼内还陈设有数百件艺术品。</p>'),(27,29,'zh_cn','<p>不同风格、不同方式的会议室更可为您的会议需求及休闲度假提供一个理想而满意的场所。</p>'),(29,29,'en','<p></p><p>no</p><p><br/></p>'),(33,37,'zh_cn','<p>大型会议会创意而时尚的优雅会所及餐饮场所，是私人聚会、婚宴、产品推介、鸡尾酒会及公司会议的理想选择。</p>'),(35,37,'en','<p>Valeri was a new student . She walked to class with her books huddled \r\nagainst her chest and her head down . He talked only when the teacher \r\nasked her a question . After a month at our school , she hadn&#39;t made any\r\n friend . At recess , she sat on a bench and read . If you asked who she\r\n was , you&#39;d get a response like this , &quot;She&#39;s in my PE class , I can&#39;t \r\nremenber her name .&quot;</p>');

#
# Structure for table "vcos_member"
#

DROP TABLE IF EXISTS `vcos_member`;
CREATE TABLE `vcos_member` (
  `member_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '会员id',
  `smart_card_number` varchar(50) DEFAULT '0' COMMENT '智能卡号',
  `member_code` varchar(32) DEFAULT NULL COMMENT '会员号',
  `member_name` varchar(50) DEFAULT NULL COMMENT '会员名',
  `member_email` varchar(100) DEFAULT '168@888.888' COMMENT '会员邮箱',
  `member_password` varchar(100) DEFAULT '888888' COMMENT '密码',
  `cn_name` varchar(100) DEFAULT NULL,
  `last_name` varchar(100) DEFAULT NULL COMMENT '姓',
  `first_name` varchar(100) DEFAULT NULL COMMENT '名',
  `sex` enum('2','1') DEFAULT '1' COMMENT '性别：1男，2女',
  `date_of_birth` int(11) DEFAULT '0' COMMENT '出生日期',
  `birth_place` varchar(250) DEFAULT NULL COMMENT '出生地',
  `nationality` varchar(150) DEFAULT NULL COMMENT '国籍(弃用)',
  `country_code` varchar(16) DEFAULT NULL COMMENT '国籍代号',
  `nation_code` varchar(2) DEFAULT NULL COMMENT '民族',
  `mobile_number` varchar(20) DEFAULT NULL COMMENT '手机',
  `fixed_telephone` varchar(20) DEFAULT NULL COMMENT '固定电话',
  `email_verification` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '邮箱验证，默认0未验证，1验证',
  `mobile_verification` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '手机验证0未验证，1验证',
  `member_level` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '会员等级，默认0',
  `member_money` double(100,0) DEFAULT '0' COMMENT '会员金额',
  `member_credit` int(11) DEFAULT '0' COMMENT '会员积分',
  `member_verification` tinyint(4) NOT NULL DEFAULT '0' COMMENT '会员激活，0默认未激活，1激活,2冻结',
  `passport_number` varchar(20) DEFAULT NULL COMMENT '护照号',
  `passport_date_issue` bigint(11) DEFAULT '0' COMMENT '签发日期',
  `passport_place_issue` varchar(100) DEFAULT NULL COMMENT '签发地',
  `passport_issue_country_code` varchar(10) DEFAULT NULL COMMENT '护照发行国',
  `passport_expiry_date` int(11) DEFAULT NULL COMMENT '护照到期时间',
  `resident_id_card` varchar(32) DEFAULT NULL COMMENT '居民身份证',
  `id_card_issuing_authority` varchar(100) DEFAULT NULL COMMENT '身份证签发机关',
  `id_card_address` varchar(100) DEFAULT NULL COMMENT '身份证住址',
  `id_card_start_date` int(11) DEFAULT '0' COMMENT '身份证开始日期',
  `id_card_expiry_date` int(11) DEFAULT '0' COMMENT '身份证截止日期',
  `reg_time` int(11) DEFAULT '0' COMMENT '注册时间',
  `reg_ip` varchar(100) DEFAULT NULL COMMENT '注册ip,可兼容ipv6',
  `create_by` varchar(32) DEFAULT NULL COMMENT '创建人',
  `create_time` int(11) DEFAULT '0' COMMENT '创建时间',
  `is_online_booking` tinyint(4) DEFAULT '0' COMMENT '在线预订代理商：0不是，1是',
  `sign` varchar(128) DEFAULT NULL,
  `overdraft_limit` int(11) DEFAULT '0' COMMENT '最大透支额',
  `curr_overdraft_amount` int(11) DEFAULT '0' COMMENT '当前消费额',
  PRIMARY KEY (`member_id`)
) ENGINE=InnoDB AUTO_INCREMENT=11932 DEFAULT CHARSET=utf8 COMMENT='会员表';

