INSERT INTO `vcos_restaurant_language` VALUES (2,46,'zh_cn','肯德基','3楼大堂','炸鸡','来自美国的快餐','24小时'),(3,46,'en','kfc','level3 lobby','fried chicken','America fastfood','7*24H'),(13,51,'zh_cn','望海轩','楼层2','辣的','<p>模式1</p>','9：00-24：00'),(15,51,'en','wanghaixuan','loucheng2','laide','moshi1','7*24h'),(17,53,'zh_cn','特色餐厅','楼层2','好吃','<p>米萝餐厅的美妙瑰丽与我们营造的优雅、温馨氛围一脉相承。</p>','9：00-24：00'),(19,53,'en','tese','two','haochi','very good','24xiaoshi'),(25,45,'zh_cn','绝味鸭脖','出门右转','吃了别想跑','<p>好好吃</p>','12小时'),(27,45,'en','jueweiyabo','chumenzuozhuan','clbxp','<p></p><p>good</p><p><br/></p>','12'),(33,67,'zh_cn','心悦海洋','第五层甲板尾部','米白色调，具有自然风情，专业艺术团队研发造型，让每一款菜品成为一件艺术品，让客人感受别样的饮食文化','<p>地道的可口佳肴将让乘客享受无与伦比的味觉体验风格比较独特独特，与一般的餐厅的暖色调为主不同，它以鲜明幽雅色调为主温馨的就餐环境，让每一个食客，在这里忘记都市的嘈杂，进入雍容空间。</p><p><br/></p>','9：00-14：00'),(35,73,'zh_cn','米萝餐厅','第五层甲板尾部','店内以蓝色绿色为主色调，优雅舒适。','<p>米萝餐厅的美妙瑰丽与我们营造的优雅、温馨氛围一脉相承。主要是提供中餐和晚餐两顿正餐的餐厅或餐厅。提供零点服务，菜单内容品种丰富</p>','17：00-20：00'),(37,75,'zh_cn','海威娜餐厅','第五层甲板尾部','很浓郁的中国风的餐厅，环境华丽，让人迷醉。做得是创意菜，中西结合。','<p>午日咖啡采用一流材料调制，训练有素的厨师技艺高超、锐意创新。</p><p>休闲风格以舒适为主题，所有的陈设看起来都非常柔软闲适：明亮的布面沙发，大棵的绿色植物具有现代感的茶具，都把人立刻带入一种放松的状态</p>','9：00-22：00'),(39,77,'zh_cn','望海轩餐厅','第五层甲板中央大厅','给你一种或是回忆,或是文化,或是博君一笑的美好氛围,多方位感官刺激，这就是望海轩餐厅。','<p>独特海鲜秘汁烧烤，私厨的美味，用心的烹制大家喜欢的美食佳肴，贴心的为大家周到服务，望海轩的一切，都让人感到清新又欣喜。感受望海轩的文化，品味舌尖上的鲜香。</p>','11:00-19:00   '),(41,79,'zh_cn','泰芒果泰国餐厅','3层甲板','酸辣色香味，正宗泰式餐厅，餐厅别具泰国风情格调的幽雅环境，装修温馨别致，充满了异国情调','<p><span style=\"font-family: arial,helvetica,sans-serif;\">特色泰国风味，<span id=\"mynetAspectPanel\" style=\"position: relative;\">\r\n 餐厅特请外籍乐队，现场歌舞表演，即兴式走动表演，以互动的形式， \r\n针对不同的宾客， 或带去生日歌，或为情侣们唱首爱情歌曲，<span style=\"font-family: arial,helvetica,sans-serif;\"><span id=\"mynetAspectPanel\" style=\"position: relative;\">，演绎的热情，充满活力。</span></span></span></span></p>','12:00-21:00'),(43,81,'zh_cn','贵族世家牛排','4层甲板','最原始经典的美味，甄选的牛肉料理，用油煎至表面呈金黄，加入了自创的白葡萄酒，不仅烹饪手法别具一格，而且还有自己独特的食用技巧','<p>四分熟是最好的熟度，肉从内部已经温热，但是还是能吃到内部未熟部分的柔软和汁水。再生一分，温度不够；再熟一分，口感不对。外熟里内的牛排，是你享受西式口味的最佳选择。<br/></p>','8:00-21:00'),(45,83,'zh_cn','大西洋超级牛扒','2层甲板','曼妙的乐曲声，轻快悠闲慵懒自在，欧式的装饰风格，时尚大气，而浪漫的主角牛排，每一款都给食客带来浓浓的惊喜','<pre id=\"best-content-1660351704\" class=\"best-text mb-10\"><span style=\"font-family: arial,helvetica,sans-serif;\">每一款牛肉都有自己的独特之处，比如有的牛肉靠近牛骨头，做出来会带有一种“骨香”；有的肉质较嫩，纹路如大理石般且油花分部平均，经过香辛料腌制，特有嚼劲</span><br/></pre><p><br/></p>','9:00-23:00'),(47,83,'en','The Atlantic super steak','Xiangzhou District Yingbin Road No. 1099 Milan Department Store Plaza, two floor No. B006','Delicious','<p>Good service attitude.</p>','9:00-23:00'),(49,85,'zh_cn','夜郎蛙','3层甲板','特色味道浓郁，脾气蛙的汤色呈火辣辣的红，蛙的味道也比泼妇蛙重很多，麻辣鲜香重口味','<p>这一家妙味香美蛙鱼头是自助形式，个头非大只的美国青蛙合着鱼头一起在铺满辣椒、花椒的重庆重口味锅底里翻煮，煮好的美蛙是这样的。色香味俱全让人颇具食欲</p>','12:00-21:30'),(51,85,'en','ylw','xiangzhou','Hardcore','<p>Heap praise</p>','12:00-21:30'),(53,87,'zh_cn','御可●贡茶','2层甲板','世界的好茶，暖暖的氛围，茶香盈在身上，品一杯清茶，悠闲而惬意。','<p style=\"text-align:justify;\">口味方面，作为传承了数千年的配方，取材方面，御可贡茶数百年来一直采用台湾阿里山脉的绿茶和乌龙茶作为饮品的主材，原有配方的基础上，鲜牛奶冷加工，使之成为口味多样的新品贡茶，御可贡茶在口味上堪称一绝。。</p><p><br/></p>','11:00-22:00'),(55,89,'zh_cn','自助餐','三层甲板中','美味便宜','<p>随便吃<br/></p>','12：21'),(59,97,'zh_cn','湖南小吃','三楼','美味','<p>123456789<br/></p>','12：00-24：00');

