INSERT INTO `vcos_room_detail_language` VALUES (1,1,'zh_cn','<p><span style=\"font-family:Arial;font-size:16px\">以米色为主色调的海景房，给人一种安静舒适之感。同时，设计巧妙的环绕式<span style=\"line-height: 1.5;\">阳台，也为此处增添了一抹迷人的韵致。</span></span></p>'),(2,2,'zh_cn','<p><span style=\"font-family:Arial;font-size:16px\">这套海景房，拥有大大的落地窗墙，可让您尽览如画的美景。同时，这儿<span style=\"line-height: 1.5;\">的超豪华的阳台、餐椅、按摩浴缸以及沙发，都会让您陶醉其中。</span></span></p>'),(3,2,'en','<p>Obama&#39;s room lol<br/></p>'),(4,1,'en','<p>permium<br/></p>'),(9,5,'zh_cn','<p><span style=\"font-family:Arial;font-size:16px\">以蓝白为主色调的总统套房，给人一种安静舒适之感。同时，设计巧妙的环绕式<span style=\"line-height: 1.5;\">阳台，也为此处增添了一抹迷人的韵致。</span></span></p><p><br/></p><p><br/></p>'),(11,5,'en','<p>neicangfang<br/></p>'),(13,25,'zh_cn','<p><span style=\"font-family:Arial;font-size:16px\">海景房均设有观景窗，供您欣赏海上壮丽的美景。总统套房和海景房是最贵的舱房，占地1245平方英尺(约124.95平方米)。其内部的天然木地板、施华洛世奇水晶壁灯以及玻璃马赛克瓷砖等，都尽显皇家气派，奢华无比。</span></p>'),(15,27,'zh_cn','<p><span style=\"font-family:Arial;font-size:16px\"><span style=\"line-height: 1.5;\">&nbsp;总统舱房均设有观景窗，供您欣赏海上壮丽的美景。总统套房和海景房是最贵的</span><span style=\"line-height: 1.5;\">舱房，占地1345平方英尺(约124.95平方米)。</span></span></p><p><br/></p>'),(17,29,'zh_cn','<p><span style=\"font-family:Arial;font-size:16px\"><span style=\"line-height: 1.5;\"></span></span><span style=\"font-family:Arial;font-size:16px\">这套双层阁楼套房，拥有大大的落地窗墙，可让您尽览如画的美景。同时，这儿<span style=\"line-height: 1.5;\">的超豪华的阳台、餐椅、按摩浴缸以及沙发，都会让您陶醉其中。</span></span></p><p><br/></p>'),(19,31,'zh_cn','<p><span style=\"font-family:Arial;font-size:16px\">&nbsp;</span><span style=\"font-family: Arial; font-size: medium; line-height: 1.5;\">其内部的天然木地板、施华洛世</span><span style=\"font-family: Arial; font-size: medium; line-height: 1.5;\">奇水晶壁灯以及玻璃马赛克瓷砖等，都尽显皇家气派，奢华无比。</span></p>'),(21,33,'zh_cn','<p><span style=\"font-family:Arial;font-size:16px\">以蓝白为主色调的标准海景房，给人一种安静舒适之感。同时，设计巧妙的环绕式<span style=\"line-height: 1.5;\">阳台，也为此处增添了一抹迷人的韵致。</span></span></p>'),(23,35,'zh_cn','<p><span style=\"font-family:Arial;font-size:16px\">这套双层阁楼套房，拥有大大的落地窗墙，可让您尽览如画的美景。同时，这儿<span style=\"line-height: 1.5;\">的超豪华的阳台、餐椅、按摩浴缸以及沙发，都会让您陶醉其中。</span></span></p>'),(25,37,'zh_cn','<p><span style=\"color: rgb(51, 51, 51); font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 28px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; float: none; display: inline !important; background-color: rgb(255, 255, 255);\"><span style=\"font-family:Arial;font-size:16px\">客房有的可以合并后成为加大尺寸的双人床，并有相应的室内设备与标准的浴室设备。</span></span></p>'),(27,39,'zh_cn','<p><span style=\"font-family:Arial;font-size:16px\">有一张双人大床，大部分可转换为两张单人床，一个带淋浴的私人浴室，以及一个书桌，抽屉空间的梳妆台。</span></p>'),(29,41,'zh_cn','<p><span style=\"font-size:16px\"><span style=\"line-height: 1.5;\">占地1345平方英尺(约124.95平方米)。其内部的天然木地板、施华洛世</span><span style=\"line-height: 1.5;\">奇水晶壁灯以及玻璃马赛克瓷砖等，都尽显皇家气派，奢华无比。</span></span></p><p><br/></p>'),(35,47,'zh_cn','<p>配有一张双人大床，大部分可转换为两张单人床，一个带淋浴的私人浴室，以及一个书桌，抽屉空间的梳妆台。每间客房内还有恒温控制的空调，直拨电话，迷你酒吧，私人保险箱，吹风机，交互电视，免费欧式早餐，以及24小时客房服务。</p>'),(37,49,'zh_cn','<p>有一张双人大床，大部分可转换为两张单人床，一个带淋浴的私人浴室，以及一个书桌，抽屉空间的梳妆台。</p>'),(39,51,'zh_cn','<p>简洁舒服为主，无舱，看不到海，安静。<br/></p>'),(41,53,'zh_cn','<p>房间没有窗户，面积一般都在15-20平米，配置基本用品。</p>'),(43,55,'zh_cn','<p>温馨色调，安静偏小，面积一般都在15平米左右。</p>'),(45,57,'zh_cn','<p>一张大床,大部分可以转换成两张单人床，一个带淋浴的私人浴室和卫生间，宽敞的衣柜空间，以及一个书桌，梳妆台。</p>'),(47,53,'en','<p>home<br/></p>'),(48,58,'zh_cn','<p>123131313</p>');

