INSERT INTO `vcos_room_language` VALUES (1,1,'zh_cn','露台房','room_images/201510/201510121027244606.jpg','配备有沙发床，个人保险箱、直拨电话、恒温式空调、迷你吧、独立起居室和用餐区。'),(2,10,'zh_cn','标准海景房','room_images/201510/201510121026028944.jpg','两张单人床可转换为一张大床，大面积壁橱，带淋浴的卫生间。同时配备空调、吹风机、卫星电视、迷你吧台及24小时客房服务。'),(3,10,'en','president room000',NULL,NULL),(4,1,'en','premium seaview room','room_images/201509/201509191201384177.jpg',NULL),(9,13,'zh_cn','海景房','room_images/201510/201510121023554533.jpg','两张单人床可转换为一张大床，大面积壁橱，带淋浴的卫生间。同时配备空调、吹风机、卫星电视、迷你吧台及24小时客房服务。'),(11,13,'en','neicangfang','cruiseinfo_images/201509/201509191145154833.jpg',NULL),(13,15,'zh_cn','总统套房','room_images/201510/201510121022498568.jpg','配备有沙发床，以容纳第3/4位客人、私人浴室和卫生间、宽敞的衣柜空间、书桌、梳妆台、热水壶、吹风机、交互电视、个人保险箱、直拨电话、恒温式空调、迷你吧；贵宾礼遇。 '),(15,15,'en','huangshi','room_images/201509/201509191228066701.jpg',NULL),(17,17,'zh_cn','内舱房','room_images/201510/201510121019483612.jpg','单人床，大面积壁橱，带淋浴的卫生间。同时配备空调、吹风机、卫星电视、迷你吧台及24小时客房服务。'),(19,19,'zh_cn','标准内舱房','room_images/201510/201510121018004351.jpg','两张单人床可转换为一张大床，大面积壁橱，带淋浴的卫生间。同时配备空调、吹风机、卫星电视、迷你吧台及24小时客房服务。'),(23,23,'zh_cn','海景贵宾房','room_images/201510/201510111715065598.jpg','超级豪华'),(25,25,'zh_cn','海景豪华贵宾房','room_images/201510/201510111714519825.jpg','超豪华dd'),(27,27,'zh_cn','二人阳台房','room_images/201510/201510130931324520.png','享受二人世界，不用怕被打扰，舒适干净，有独立的洗手间和梳妆台。享受二人世界，不用怕被打扰，舒适干净，有独立的洗手间和梳妆台。享受二人世界，不用怕被打扰，舒适干净'),(29,29,'zh_cn','四人阳台房','room_images/201510/201510130957028294.jpg','全景阳台房 Balcony Cabin，房间面积20-26平方米。'),(37,41,'zh_cn','套房&&','room_images/201510/201510131455102694.jpg','配备有沙发床，以容纳第3/4位客人、');

