INSERT INTO `vcos_safe_language` VALUES (1,1,'zh_cn','安全规定','<p><span style=\"font-size: 16px;\">本船舶配有最先进的安保设备及系统，符合I.M.O.国际海事组织（International amartime Organization）<span style=\"font-size: 16px;\">颁布的</span>《国际海上人命安全公约》（International Convention for the Safety of Life at Sea）.<br/>\r\n &nbsp; &nbsp; &nbsp; &nbsp;<br/>根据国内外相关规定，船舶设计旨在处理任何类型的紧急事件。<br/>\r\n &nbsp; &nbsp; &nbsp; &nbsp;<br/>我们的工作人员均边续参加过高度专业课程，有资质并可妥善处理紧急事件的每个阶段。船上的消防队也接受相关培训，可处理极端情况</span></p><p><br/><span style=\"font-size: 16px;\"></span></p><p><span style=\"font-size: 16px;\">紧急信号由7声鸣响后1声长鸣组成的一般警报信号是指示您采取行动的唯一警报信号。<span style=\"font-size: 16px;\"> &nbsp; &nbsp; &nbsp;&nbsp; <br/></span></span></p><p><span style=\"font-size: 16px;\"><span style=\"font-size: 16px;\">当您听到警报拉响，您必须返回</span>船舱，空上救生衣，并前往集合点。\r\n &nbsp; &nbsp; &nbsp; &nbsp;</span></p><p><span style=\"font-size: 16px;\">如果您无回到自己的船舱并且没有救生衣，也不必担心，集合点会提前供备用的成人及儿童不救生衣。</span></p><p><span style=\"font-size: 16px;\">\r\n &nbsp; &nbsp; &nbsp; &nbsp;</span></p><p><span style=\"font-size: 16px;\">在您救生衣以及船舱门背面的卡片上清楚地标明了您的集合点以及前往集合点的最佳路线<strong>。</strong>如果您按照船上的绿色信号前进，整个流程将十分简捷。 &nbsp; &nbsp; &nbsp; </span></p><p><span style=\"font-size: 16px;\">\r\n &nbsp; &nbsp; &nbsp; <br/>请尽快前往您的集合点并验证从您的船舱前往集合点的路线。<br/>\r\n &nbsp; &nbsp; &nbsp; <br/>请劳记，当紧急警报拉响时，我们训练有素的工作人员在任何情况下都会站在船上的紧急情况重要位置，为您提供协助，并指引您前往集合点。</span></p><p><span style=\"color:#444444;font-size:16px\"><br/></span><br/></p>'),(2,2,'zh_cn','救生设备','<p><span style=\"font-size:16px\">我们为儿童和婴儿提供的小号救生衣置于船舱中。&nbsp;&nbsp; &nbsp; <br/>所有成人救生衣也设计用于超重或身形魁梧的人士；如船上没有大号救生衣，您可在集合点领取延长带以系好安全带，让救生衣穿着舒适服帖。我们为每一位儿童提供一个身份识别手环，手环上标有集合点的位置</span></p>'),(3,3,'zh_cn','安全介绍','<p><span style=\"font-size:16px\"></span></p><p><span style=\"font-size:16px\">贴于船舱门背后的标牌上有更多安全信息及指示。&nbsp; <br/></span></p><p><span style=\"font-size:16px\">按照《国际海上人命安全公约》的规定，您在启航前应携带客房内的应急演练卡参加一般紧急情况演练。&nbsp;&nbsp; &nbsp;&nbsp; <br/></span></p><p><span style=\"font-size:16px\">熟悉一般紧急信号&nbsp;&nbsp; <br/></span></p><p><span style=\"font-size:16px\">学会正确使用救生衣&nbsp;&nbsp;&nbsp; <br/></span></p><p><span style=\"font-size:16px\">熟悉紧急状况下的集合点位置、抵达集合点的路线，以及听到警报信号时应采取的行动。</span></p><p><br/></p><p><br/></p>'),(4,4,'zh_cn','安全指引','<p><span style=\"font-size:16px\">如有烟雾，请尽可能地弯腰低身前过，以呼吸较为洁净而新鲜的空气，并沿地板上的光带前往最近的完全出口。<br/>\r\n &nbsp; &nbsp; &nbsp; &nbsp;<br/>在真正发生紧情况时，救生艇将在登船甲板准备就绪。请谨记这并不意味着要弃船，而是为万一弃船做好必要准务工作。<br/>\r\n &nbsp; &nbsp; &nbsp; &nbsp;<br/>弃船指令只限船长口头发出。<br/>\r\n &nbsp; &nbsp; &nbsp; &nbsp;<br/>如需弃船，游客必须用一只手搭住前一位的肩，排队前往登艇点。<br/>\r\n &nbsp; &nbsp; &nbsp; &nbsp;</span><br/></p><p><span style=\"font-size:16px\">船舶上配备的救生艇数量足够全部游客使用。</span></p><p><span style=\"font-size:16px\">\r\n &nbsp; &nbsp; &nbsp; &nbsp;</span></p><p><span style=\"font-size:16px\">也配有充气救生筏可供使用。</span></p><p><span style=\"font-size:16px\">\r\n &nbsp; &nbsp; &nbsp; &nbsp;</span></p><p><span style=\"font-size:16px\">抵达救生艇时，请按工作人员的指示行事。患有残疾的游客将最后登艇，以方便他们上下船。</span></p><p><span style=\"font-size:16px\">\r\n &nbsp; &nbsp; &nbsp; &nbsp;</span></p><p><span style=\"font-size:16px\">如果您在紧急情况时行动不便需要协助，请告知负责接待的工作人员。</span></p><p><br/></p>'),(5,4,'en','anquanzhiyin','<p>444<br/></p>'),(7,1,'en','','<p>3<br/></p>'),(9,2,'en','','<p>ss<br/></p>'),(11,3,'en','','<p>4<br/></p>');

