#
# Structure for table "vcos_strategy_language"
#

DROP TABLE IF EXISTS `vcos_strategy_language`;
CREATE TABLE `vcos_strategy_language` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `strategy_id` int(11) DEFAULT NULL,
  `strategy_name` varchar(100) DEFAULT NULL,
  `strategy_describe` varchar(255) DEFAULT NULL COMMENT '描述',
  `show_style` tinyint(4) DEFAULT '0' COMMENT '1大图，2列表，3多图',
  `img_url` varchar(255) DEFAULT NULL,
  `img_url2` varchar(255) DEFAULT NULL,
  `img_url3` varchar(255) DEFAULT NULL,
  `avg_price` int(11) DEFAULT NULL,
  `address` varchar(255) DEFAULT NULL,
  `strategy_type` varchar(100) DEFAULT NULL COMMENT '类别',
  `telphone` varchar(20) DEFAULT NULL,
  `strategy_feature` varchar(255) DEFAULT NULL COMMENT '特色',
  `strategy_details` text COMMENT '详情',
  `iso` varchar(10) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `strategy_id&iso` (`strategy_id`,`iso`)
) ENGINE=InnoDB AUTO_INCREMENT=268 DEFAULT CHARSET=utf8 COMMENT='城市攻略语言表';

#
# Data for table "vcos_strategy_language"
#

INSERT INTO `vcos_strategy_language` VALUES (1,1,'大连美食店铺','在大连的各大美食街、路边烧烤摊都能看到烤鱿鱼的身影，受欢迎程度可见一斑。',1,'strategy_images/201510/201510111448572359.jpg',NULL,NULL,200,'甲板七层','烧烤','13750087547','在大连的各大美食街、路边烧烤摊都能看到烤鱿鱼的身影，受欢迎程度可见一斑。','<p>大连的铁板烤鱿鱼十分有名，当地产的鱿鱼肉质鲜嫩，烤到恰到好处时刷上蒜蓉辣酱，吃过担保会上瘾。在大连的各大美食街、路边烧烤摊都能看到烤鱿鱼的身影，受欢迎程度可见一斑。 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>','zh_cn'),(2,2,'乌鱼子','将乌鱼卵用盐腌制，去掉盐汁，就制成了乌鱼子。由于形状像中国的墨，所以也称唐墨。把乌鱼子微微熏烤后，切成薄片就可以下酒了。',1,'strategy_images/201510/201510111455233154.jpg',NULL,NULL,1000,'甲板二层','下酒点心','18723131397','将乌鱼卵用盐腌制，去掉盐汁，就制成了乌鱼子。由于形状像中国的墨，所以也称唐墨。把乌鱼子微微熏烤后，切成薄片就可以下酒了。','<p>美食</p>','zh_cn'),(3,5,'大连商场','礼服购买',2,'strategy_images/201510/201510111619287722.jpg',NULL,NULL,120,'甲板三层','购物','13750087547','样式多','<p>样式多<br/></p>','zh_cn'),(9,13,'蓬莱阁','蓬莱阁的天后宫是我国北方最大的天后宫庙宇之一。正中端坐的是天后，再塑金身。天后是海峡两岸人民虔诚信奉的海神',1,'strategy_images/201510/201510091338009299.jpg',NULL,NULL,5000,'烟台','风景','13750087547','独特','<p>哈哈哈哈a</p>','zh_cn'),(13,15,'极乐寺','极乐寺位于亚依淡（AirHitam），面积12万平方米，乃是东南亚最大的佛寺，寺内五彩缤纷的建筑鳞次栉比，无论是当地华人还是游客都乐于前往',1,'strategy_images/201510/201510111604594467.jpg',NULL,NULL,3000,'马来西亚','免费','13750087547','历史','<p>历史</p>','zh_cn'),(17,17,'七浦路服装批发市场 ','用心就能搭配成超级大牌的模样。可能花个百元，你就成了个超级有范儿的弄潮儿，鞋子裤子衣服帽子一样不拉，超级有成就感',1,'strategy_images/201510/201510091605194173.jpg',NULL,NULL,200,'上海','生活','1723131397','应有尽有','<p>满足您一切所需</p>','zh_cn'),(23,23,'标准大房','标准宽度，大床',1,'strategy_images/201509/201509291516472094.jpg',NULL,NULL,200,'甲板四层','住宿','13750087547','舒适','<p>标准大房，舒适温馨<br/></p>','zh_cn'),(25,25,'贵宾房','豪华贵宾房',1,'strategy_images/201509/201509291516329499.jpg',NULL,NULL,550,'甲板五层','住房','13825173818','豪华','<p>贵宾房内设水上泡澡，超软大床<br/></p>','zh_cn'),(27,27,'蓬莱小面','蓬莱小面是蓬莱传统名吃，历史悠久。每碗的面坯为50g，卤多面少，盛面的器皿又小巧玲珑，故称“蓬莱小面”。',1,'strategy_images/201510/201510091020175306.jpg',NULL,NULL,500,'甲板三层中部','鲁菜','18723131397','蓬莱小面是蓬莱传统名吃，历史悠久。每碗的面坯为50g，卤多面少，盛面的器皿又小巧玲珑，故称“蓬莱小面”。面条为人工拉制','<p>美味好吃热闹蓬莱小面是蓬莱传统名吃，历史悠久。每碗的面坯为50g，卤多面少，盛面的器皿又小巧玲珑，故称“蓬莱小面”。面条为人工拉制</p>','zh_cn'),(29,29,'上海生煎包','上海生煎包可以说是土生土长的上海点心，据说已有上百年的历史。其特点为：皮酥、汁浓、肉香。轻咬一口，肉香、油香、葱香、芝麻香全部的美味在口中久久不肯散去',1,'strategy_images/201510/201510091028445466.jpg',NULL,NULL,5000,'7层甲板','小吃','18562354798','上海生煎包可以说是土生土长的上海点心，据说已有上百年的历史。其特点为：皮酥、汁浓、肉香。轻咬一口，肉香、油香、葱香、芝麻香全部的美味在口中久久不肯散去','<p>美味<br/></p>','zh_cn'),(31,31,'寿司','寿司一般可以分成手捏寿司和卷寿司。手捏寿司就是在醋味小饭团上面加上切成小片的各类新鲜海鲜，例如金枪鱼、虾、墨鱼等等',1,'strategy_images/201510/201510111507245836.jpg',NULL,NULL,2000,'7层甲板','点心','18562354798','寿司一般可以分成手捏寿司和卷寿司。手捏寿司就是在醋味小饭团上面加上切成小片的各类新鲜海鲜，例如金枪鱼、虾、墨鱼等等','<p>sk<br/></p>','zh_cn'),(33,33,'鳗鱼','日本常见的鳗鱼分为两种，一种是淡水鳗鱼，称为鰻，一般以日本本地出产的野生鳗鱼为最佳，另一种是海水中生长的星鳗，称为穴子',1,'strategy_images/201510/201510121400149252.jpg',NULL,NULL,3000,'甲板三层','小吃','15858585858','日本常见的鳗鱼分为两种，一种是淡水鳗鱼，称为鰻，一般以日本本地出产的野生鳗鱼为最佳，另一种是海水中生长的星鳗，称为穴子','<p>美味可口</p>','zh_cn'),(35,35,'味噌猪排','味噌猪排是将名古屋特有红味噌淋在刚炸起的猪排上食用，至于酱汁的味道和浓淡则各店不一，不过倒入大量酱汁淋遍整块猪排，则是名古屋特有的吃法。',1,'strategy_images/201510/201510121401464531.jpg',NULL,NULL,5000,'甲板三层','点心','15858585858','味噌猪排是将名古屋特有红味噌淋在刚炸起的猪排上食用，至于酱汁的味道和浓淡则各店不一，不过倒入大量酱汁淋遍整块猪排，则是名古屋特有的吃法。','<p>可口<br/></p>','zh_cn'),(37,37,'槟榔律驰名潮州煎蕊','槟榔律驰名潮州煎蕊有点像我们吃的刨冰，不过味道就大不一样啦，是又咸又甜的味道',1,'strategy_images/201510/201510111516005864.jpg',NULL,NULL,10000,'7层甲板','汤','15255252525','槟榔律驰名潮州煎蕊有点像我们吃的刨冰，不过味道就大不一样啦，是又咸又甜的味道','<p>又咸又甜</p>','zh_cn'),(39,39,'杨氏肉骨茶','巴生肉骨茶是全马最有名的，当地人说，也是自己的体验，随便走进一家都好吃！这边会先用茶洗餐具，然后再边喝云南普洱边吃肉骨茶。',1,'strategy_images/201510/201510091112259920.jpg',NULL,NULL,2000,'7层甲板','茶','15858585858','巴生肉骨茶是全马最有名的，当地人说，也是自己的体，随便走进一家都好吃！这边会先用茶洗餐具，然后再边喝云南普洱边吃肉骨茶。肉骨茶可以算作马来西亚最好的食物，没','<p>巴生肉骨茶是全马最有名的，当地人说，也是自己的体验——随便走进一家都好吃！这边会先用茶洗餐具，然后再边喝云南普洱边吃肉骨茶。肉骨茶可以算作马来西亚最好的食物，没有之一！<br/></p>','zh_cn'),(41,41,'鲍鱼粥','鲍鱼自古就是献给国王的贡品，营养价值高，对恢复肝功能有特效。济州海域风浪大，不适合养殖鲍鱼，因此这里出产的鲍鱼都是自然生长的',1,'strategy_images/201510/201510111535078713.jpg',NULL,NULL,1000,'7层甲板','粥','13636363636','鲍鱼自古就是献给国王的贡品，营养价值高，对恢复肝功能有特效。济州海域风浪大，不适合养殖鲍鱼，因此这里出产的鲍鱼都是自然生长的','<p>美味可口</p>','zh_cn'),(43,43,'酱炸鸡','酱炸鸡是在韩国非常流行的一种小吃，韩国许多明星都代言过酱炸鸡块，其中仁川的新浦市场酱炸鸡尤其的出名。一进入市场内，炸鸡的味道就扑面而来。',1,'strategy_images/201510/201510091128007095.jpg',NULL,NULL,2000,'7层甲板','小吃','18562354798','酱炸鸡是在韩国非常流行的一种小吃，韩国许多明星都代言过酱炸鸡块，其中仁川的新浦市场酱炸鸡尤其的出名。一进入市场内，炸鸡的味道就扑面而来。','<p>美味可口<br/></p>','zh_cn'),(45,45,' 松亭3代汤饭 ','特地去了最有名的松亭3代汤饭店，那里的老板会很热心的教你如何吃一碗猪肉汤饭，但本人并不爱这种面条与米饭的混合料理，味道不算浓烈，也不算清淡',1,'strategy_images/201510/201510091132291720.jpg',NULL,NULL,2000,'7层甲板','汤','13636363636','特地去了最有名的松亭3代汤饭店，那里的老板会很热心的教你如何吃一碗猪肉汤饭，但本人并不爱这种面条与米饭的混合料理，味道不算浓烈，也不算清淡','<p>美味可口</p>','zh_cn'),(47,51,'金石滩国家旅游度假区','金石滩国家旅游度假区位于大连市金州区的东部，距大连市区58公里，有“奇石的园林”之美称',1,'strategy_images/201510/201510111542425168.jpg',NULL,NULL,10000,'大连市金州区的东部','山水','15858585858','环境优美','<p>环境优美</p>','zh_cn'),(49,53,'外滩','有人说“外滩的故事就是上海的故事”， 外滩的精华就在于52幢风格各异被称为“万国建筑博览”的外滩建筑群',1,'strategy_images/201510/201510111239516809.jpg',NULL,NULL,500,'上海','风景','15252525252','优美','<p>优美<br/></p>','zh_cn'),(51,55,'太宰府','太宰府，现在泛指以太宰府天满宫为中心的一带景区，而在日本战国时期，这是治理九州地方的部门，此机构担当九州的防务及外交等一切政务',1,'strategy_images/201510/201510111558082032.jpg',NULL,NULL,100,'日本福冈','风景','15656565656','环境好','<p>环境好<br/></p>','zh_cn'),(53,57,'豪斯登堡','豪斯登堡位于长崎县佐世保市大村湾，占地152公顷，面积比东京迪斯尼乐园还要大两倍，是亚洲最大的休闲度假主题公园',1,'strategy_images/201510/201510091513184581.jpg',NULL,NULL,200,'日本长崎','风景','152565656565','环境优美','<p>环境优美</p>','zh_cn'),(55,59,'日本东京塔','瞭望台内大玻璃镶装，置身其中，仿佛凌空出世远离人间令人赞叹；入夜塔身骤然齐明，夜空中构成一幅绚丽图案，愈发显得神奇雄伟',1,'strategy_images/201510/201510091517464912.jpg',NULL,NULL,3300,'日本东京','风景','13838383838','环境优美','<p>环境优美<br/></p>','zh_cn'),(57,61,'名古屋城','非常漂亮的建筑，有着浓郁的日本风情。公共服务也非常好，有很多自动售货机，可以选择喜爱的饮品。',1,'strategy_images/201510/201510091521076719.jpg',NULL,NULL,2000,'日本名古屋','风景','15656565566','环境优美','<p>环境优美</p>','zh_cn'),(59,63,'巴生港','巴生港　旧名“瑞天咸港”。马来西亚最大港口，1973年建为红海与马六甲海峡之间第一个集装箱货运港',1,'strategy_images/201510/201510091532234057.jpg',NULL,NULL,2000,'马来西亚','风景','15454545454','环境优美','<p>环境优美<br/></p>','zh_cn'),(61,65,'济州岛','济州岛(chejudoisland)是久负盛名的韩国第一大岛，北距韩南部海岸90多公里，东与日本的九州岛岛隔海相望，地扼朝鲜海峡门户，地理位置十分重要',1,'strategy_images/201510/201510111613412241.jpg',NULL,NULL,3000,'韩国','风景','18585858585','环境优美','<p>环境优美<br/></p>','zh_cn'),(63,67,'仁川大桥','仁川大桥是座位于韩国仁川广域市的斜拉桥，用于连接松岛国际商务区和仁川国际机场',1,'strategy_images/201510/201510091552295872.jpg',NULL,NULL,1000,'仁川','风景','15252525252','环境优美','<p>环境优美<br/></p>','zh_cn'),(65,69,'釜山','在釜山观光大致分为海岸观光和内陆观光两部分。海岸观光主要指海水浴场、岛屿、海岸公园等，内陆观光则指釜山市内、历史遗址、金井山城、等',1,'strategy_images/201510/201510091554554432.jpg',NULL,NULL,1000,'釜山','风景','18787878787','环境优美','<p>环境优美<br/></p>','zh_cn'),(67,71,'南大街里','南大街里是烟台市最繁华的商业区，一般是到烟台购物的第一站。此外，还有不少独具特色的购物街都品类齐全，集购物、餐饮、娱乐一体。',1,'strategy_images/201510/201510091559402852.jpg',NULL,NULL,10000,'烟台','购物','15656565566','物美价廉','<p>物美价廉</p>','zh_cn'),(69,73,'天神地下街','地下街适合1、20岁的年轻小姑娘，因为里边所卖商品均是十分时尚的衣服和配饰，而且价格还不贵，适合刚刚工作，钱包不丰的年轻孩子了',1,'strategy_images/201510/201510111625456042.jpg',NULL,NULL,10000,'日本福冈','购物','15858585858','物美价廉','<p>物美价廉<br/></p>','zh_cn'),(71,75,' 浜町商业街 ','很繁华的商业街，好多小店铺，女人到了走不动道',1,'strategy_images/201510/201510091614573359.jpg',NULL,NULL,10000,'日本长崎','购物','15858585858','物美价廉','<p>物美价廉</p>','zh_cn'),(73,77,'银座','银座是东京繁华地段的最佳代表，也是东京最有价值的黄金地段，据悉，银座地区每平方米可卖到1500万日元以上，也是全世界最贵的地价',1,'strategy_images/201510/201510091623132995.jpg',NULL,NULL,1000000,'日本东京','购物','13636363636','物美价廉','<p>物美价廉<br/></p>','zh_cn'),(75,79,'大须商业街','大须商业街，规模很大，很值得好好逛一逛的',1,'strategy_images/201510/201510091639071892.jpg',NULL,NULL,100000,'日本名古屋','购物','15852525252','价廉物美','<p>价廉物美<br/></p>','zh_cn'),(77,81,'Gurney广场','很旺的商场，对面就是海，是旅客购物的最佳地点。这里国际品牌店很多如h&m,uniqlo,等等。各国的饮食店都能找到。',1,'strategy_images/201510/201510111631375391.jpg',NULL,NULL,10000,'马来西亚','购物','15852525252','价廉物美','<p>价廉物美<br/></p>','zh_cn'),(79,83,'步行街','价廉物美',1,'strategy_images/201510/201510091659351803.jpg',NULL,NULL,100000,'马来西亚','购物','15852525252','价廉物美','<p>价廉物美<br/></p>','zh_cn'),(81,85,'济州机场免税店','济州机场免税店是韩国国内唯一本国人也可以购物的免税店，只要是到济州观光的游客，任何人都可以到此购物',1,'strategy_images/201510/201510111637583429.jpg',NULL,NULL,10000,'韩国','购物','15852525252','价廉物美','<p>价廉物美<br/></p>','zh_cn'),(83,87,'仁川机场免税店','仁川机场购物攻略带你玩转机场。仁川机场面积很大，拥有众多免税店',1,'strategy_images/201510/201510091706346152.jpg',NULL,NULL,10000,'韩国','购物','15852525252','价廉物美','<p>价廉物美<br/></p>','zh_cn'),(85,89,'南浦洞购物街','韩国南浦洞购物街别样体验，让你感受韩国特色的购物圣地，这里不仅是享受电影等文化生活的好地方',1,'strategy_images/201510/201510091711028652.jpg',NULL,NULL,10000,'韩国','购物','15852525252','价廉物美','<p>价廉物美</p>','zh_cn'),(87,91,'机场','    大连国际机场即大连周水子国际机场始建于1972年10月，现已成为国家一级民用国际机场，是国内主要干线机场和国际定期航班机\r\n',1,'strategy_images/201510/201510111642404028.jpg',NULL,NULL,100000,'大连','交通','16565656565','方便','<p>方便</p>','zh_cn'),(89,93,'烟台莱山机场','    烟台莱山国际机场于1984年10月开航，属军民合用机场。飞行区等级为4E级，跑道长3200米，可满足波音747等大型飞机\r\n',1,'strategy_images/201510/201510091720563630.jpg',NULL,NULL,10000,'烟台市莱山区空港路','交通','535625377','方便','<p>方便</p>','zh_cn'),(91,97,'浦东国际机场','上海浦东国际机场位于上海市东边，靠近滨海地带，距市中心约30公里，是中国（包括港、澳、台）三大国际机场之一，主要以国际航',1,'strategy_images/201510/201510091726302261.jpg',NULL,NULL,10000,'浦东新区启航路900号','交通','02196990','方便','<p>方便<br/></p>','zh_cn'),(93,99,'     福冈国际机场','     福冈国际机场',1,'strategy_images/201510/201510111647018482.jpg',NULL,NULL,100000,'日本福冈','交通','05356253777','方便','<p>&nbsp;&nbsp;&nbsp;&nbsp; 福冈国际机场</p>','zh_cn'),(95,101,'长崎机场','长崎机场建于1975年，是由浮于长崎县中央部大村湾的萁岛填海而建，是世界上第一个海上机场',1,'strategy_images/201510/201510091733168966.jpg',NULL,NULL,100000,'日本','交通','16565656565','方便','<p>方便<br/></p>','zh_cn'),(97,103,'东京羽田国际机','东京羽田国际机场建于 1931年8月，最早是一所国营的民航机场',1,'strategy_images/201510/201510091735469485.jpg',NULL,NULL,100000,'日本','交通','16565656565','方便','<p>东京羽田国际机场建于 1931年8月，最早是一所国营的民航机场</p>','zh_cn'),(99,105,'     名古屋中部国际机场 ','名古屋中部国际机场是日本第三座填海造陆的机场，前两座为长崎机场及关西国际机场',1,'strategy_images/201510/201510091737419172.jpg',NULL,NULL,100000,'日本','交通','05356253777','方便','<p>名古屋中部国际机场是日本第三座填海造陆的机场，前两座为<a target=\"_blank\" href=\"http://baike.baidu.com/view/6584110.htm\">长崎机场</a>及<a target=\"_blank\" href=\"http://baike.baidu.com/view/365636.htm\">关西国际机场</a></p>','zh_cn'),(101,107,'     槟城国际机场 ','槟城国际机场（IATA:PEN，IACO:WMKP），是一座位于马来西亚槟城的民用机场，位于槟城州首府乔治市以南16公里，是马来西亚航空的重点城市',1,'strategy_images/201510/201510111652412647.jpg',NULL,NULL,100000,'马来西亚','交通','15852525252','方便','<p>槟城国际机场（IATA:PEN，IACO:WMKP），是一座位于马来西亚槟城的民用机场，位于<a target=\"_blank\" href=\"http://baike.baidu.com/view/428221.htm\">槟城州</a>首府乔治市以南16公里，是马来西亚航空的重点城市</p>','zh_cn'),(103,109,'巴生港 ','巴生港为东南亚马来西亚联邦的最大港口，位于马六甲海峡的东北部。',1,'strategy_images/201510/201510091749092946.jpg',NULL,NULL,10000,'马来西亚','交通','15852525252','方便','<p>巴生港为东南亚马来西亚联邦的最大港口，位于<a target=\"_blank\" href=\"http://baike.baidu.com/view/15939.htm\">马六甲海峡</a>的东北部。</p>','zh_cn'),(105,111,'济州国际机场 ','济州国际机场 位于韩国济州岛济州市，建于1968年。2006年接待旅客达12,109,788 人次，是韩国第三大机场',1,'strategy_images/201510/201510111658341246.jpg',NULL,NULL,10000,'韩国','交通','02196990','方便','<p>方便</p>','zh_cn'),(107,113,'仁川国际机场','仁川国际机场韩国最大的民用机场，亚洲第6位最繁忙的国际机场',1,'strategy_images/201510/201510100847494026.jpg',NULL,NULL,10000,'韩国','交通','16565656565','方便','<p><a target=\"_blank\" href=\"http://baike.baidu.com/view/194472.htm\">仁川国际机场</a>韩国最大的民用机场，亚洲第6位最繁忙的国际机场</p>','zh_cn'),(109,115,'釜山金海国际机场','釜山金海国际机场（三字代码（IATA）： PUS；四字代码（ICAO）：RKPK）位于釜山广域市江西区大渚2洞2350号，是韩国第二大国际机场，是大韩航空及韩亚航空的重点城市。',1,'strategy_images/201510/201510100852301258.jpg',NULL,NULL,100000,'韩国','交通','02196990','方便','<p><a target=\"_blank\" href=\"http://baike.baidu.com/view/25039.htm\">釜山</a>金海国际机场（<a target=\"_blank\" href=\"http://baike.baidu.com/subview/1301538/1301538.htm\">三字代码</a>（<a target=\"_blank\" href=\"http://baike.baidu.com/subview/362843/362843.htm\">IATA</a>）： PUS；四字代码（ICAO）：RKPK）位于釜山<a target=\"_blank\" href=\"http://baike.baidu.com/view/580537.htm\">广域市</a><a target=\"_blank\" href=\"http://baike.baidu.com/view/3379862.htm\">江西区</a>大渚2洞2350号，是韩国第二大国际机场，是大韩航空及韩亚航空的重点城市。</p>','zh_cn'),(111,117,'大连海景酒店','酒店历史比较久，所以设施略显陈旧，但总体环境非常不错，房间大、干净而且能看到旁边的大海，服务也可以',1,'strategy_images/201510/201510111706216440.jpg',NULL,NULL,41100,' 大连 中山区 港湾街2号 ，近人民路口','住宿','15852525252','环境优美','<p><a target=\"_blank\" href=\"http://you.ctrip.com/hotels/Dalian4/21231635.html#ctm_ref=gs_ttd_261012_33_hod_2_4_undefined_rN_sN_tN_fN_D_0\">大连海景酒店</a></p>','zh_cn'),(113,119,'烟台马山寨高尔夫酒店','烟台马山寨高尔夫酒店座落于马山寨最高处的古锋火台旁，与自然环境融为一体，海天一色，景观迷人。酒店共有十层，三面临海',1,'strategy_im