#
# Structure for table "vcos_wifi_service"
#

DROP TABLE IF EXISTS `vcos_wifi_service`;
CREATE TABLE `vcos_wifi_service` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `membership_id` int(11) DEFAULT NULL,
  `membership_code` varchar(32) DEFAULT NULL,
  `total_wifi_time` int(11) DEFAULT NULL COMMENT '总wifi时间',
  `membership_amount` int(11) DEFAULT NULL COMMENT 'wifi账号金额',
  `mobile_number` varchar(18) DEFAULT NULL COMMENT '手机号码',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

