DROP TABLE IF EXISTS `vcos_wifi_service_order`;
CREATE TABLE `vcos_wifi_service_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `membership_id` int(11) DEFAULT NULL,
  `membership_code` varchar(32) DEFAULT NULL COMMENT '会员卡号',
  `wifi_service_name` varchar(100) DEFAULT NULL,
  `wifi_service_price` int(11) DEFAULT NULL,
  `wifi_service_time` int(11) DEFAULT NULL COMMENT '分为单位',
  `wifi_order_number` varchar(32) DEFAULT NULL,
  `wifi_order_time` int(11) DEFAULT NULL,
  `order_price` int(11) DEFAULT NULL COMMENT '订单原价',
  `discount_price` int(11) DEFAULT NULL COMMENT '折扣价',
  `pay_price` int(11) DEFAULT NULL COMMENT '最后支付价',
  `wifi_order_state` tinyint(4) DEFAULT NULL COMMENT '订单状态：0下单，1 完成，2退单',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8 COMMENT='wifi服务订单表';

