#
# Trigger "mysign"
#

DROP TRIGGER IF EXISTS `mysign`;
CREATE DEFINER='root'@'localhost' TRIGGER `test_mobile`.`mysign` BEFORE UPDATE ON `test_mobile`.`vcos_member`
  FOR EACH ROW BEGIN
	if NEW.member_code!=OLD.member_code THEN
		SET NEW.sign=MD5(CONCAT(MD5(NEW.member_code),MD5(NEW.passport_number),MD5(NEW.member_password)));
	END if;
	if NEW.passport_number!=OLD.passport_number THEN
		SET NEW.sign=MD5(CONCAT(MD5(NEW.member_code),MD5(NEW.passport_number),MD5(NEW.member_password)));
	END if;
	if NEW.member_password!=OLD.member_password THEN
		SET NEW.sign=MD5(CONCAT(MD5(NEW.member_code),MD5(NEW.passport_number),MD5(NEW.member_password)));
	END if;
END;

#
# Trigger "myupdate"
#

DROP TRIGGER IF EXISTS `myupdate`;
CREATE DEFINER='root'@'localhost' TRIGGER `test_mobile`.`myupdate` BEFORE UPDATE ON `test_mobile`.`user`
  FOR EACH ROW BEGIN
if NEW.username!=OLD.username THEN
	SET NEW.authKey=MD5(NEW.username);
	END if;
END;
